import React, { useState } from 'react';
import { Container, Typography, Grid, Paper, Box, AppBar, Toolbar, IconButton, Menu, MenuItem, CssBaseline, Button, Avatar, Drawer, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { Menu as MenuIcon, Dashboard as DashboardIcon, ShoppingCart as ShoppingCartIcon, Settings as SettingsIcon, LocalShipping as LocalShippingIcon, People as PeopleIcon, ExitToApp as ExitToAppIcon, Calculate as CalculateIcon } from '@mui/icons-material';
import axios from 'axios';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#1c1c1c',
      paper: '#2c2c2c',
    },
    text: {
      primary: '#ffffff',
    },
  },
});

function FeeCalculatorPage() {
  const [salePrice, setSalePrice] = useState('');
  const [marketplace, setMarketplace] = useState('');
  const [fee, setFee] = useState(null);
  const [error, setError] = useState(null);
  const [selectedMarketplace, setSelectedMarketplace] = useState('');

  const handleCalculateFee = async () => {
    try {
      const response = await axios.post('http://localhost:5000/api/calculate_fee', {
        sale_price: parseFloat(salePrice),
        marketplace: marketplace,
      });
      setFee(response.data.fee);
      setError(null);
    } catch (err) {
      if (err.response && err.response.data) {
        setError(err.response.data.error);
      } else {
        setError('An unexpected error occurred');
      }
      setFee(null);
    }
  };

  const [anchorEl, setAnchorEl] = React.useState(null);
  
  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const drawerWidth = 240;

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="fixed" sx={{ zIndex: theme.zIndex.drawer + 1 }}>
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu" onClick={handleMenuOpen}>
            <MenuIcon />
          </IconButton>
          <Menu anchorEl={anchorEl} open={Boolean(anchorEl)} onClose={handleMenuClose}>
            <MenuItem component={Link} to="/showcase" onClick={handleMenuClose}>Showcase</MenuItem>
            <MenuItem component={Link} to="/pricing" onClick={handleMenuClose}>Pricing</MenuItem>
          </Menu>
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            FlipVault
          </Typography>
          <Button color="inherit" component={Link} to="/login">Log in</Button>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          [`& .MuiDrawer-paper`]: { width: drawerWidth, boxSizing: 'border-box' },
        }}
      >
        <Toolbar />
        <Box sx={{ overflow: 'auto' }}>
          <List>
            <ListItem button component={Link} to="/overview" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <DashboardIcon />
              </ListItemIcon>
              <ListItemText primary="Overview" />
            </ListItem>
            <ListItem button component={Link} to="/orders" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <ShoppingCartIcon />
              </ListItemIcon>
              <ListItemText primary="Orders" />
            </ListItem>
            <ListItem button component={Link} to="/products" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <ShoppingCartIcon />
              </ListItemIcon>
              <ListItemText primary="Products" />
            </ListItem>
            <ListItem button component={Link} to="/settings" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <SettingsIcon />
              </ListItemIcon>
              <ListItemText primary="Settings" />
            </ListItem>
            <ListItem button component={Link} to="/shipment" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <LocalShippingIcon />
              </ListItemIcon>
              <ListItemText primary="Shipment" />
            </ListItem>
            <ListItem button component={Link} to="/employee" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <PeopleIcon />
              </ListItemIcon>
              <ListItemText primary="Employee" />
            </ListItem>
            <ListItem button component={Link} to="/fee-calculator" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <CalculateIcon />
              </ListItemIcon>
              <ListItemText primary="Fee Calculator" />
            </ListItem>
            <ListItem button component={Link} to="/logout" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <ExitToAppIcon />
              </ListItemIcon>
              <ListItemText primary="Log Out" />
            </ListItem>
          </List>
        </Box>
      </Drawer>
      <Box component="main" sx={{ flexGrow: 1, p: 3, ml: drawerWidth }}>
        <Toolbar />
        <Routes>
          <Route path="/overview" element={<Overview />} />
          <Route path="/orders" element={<Orders />} />
          <Route path="/products" element={<Products />} />
          <Route path="/settings" element={<Settings />} />
          <Route path="/shipment" element={<Shipment />} />
          <Route path="/employee" element={<Employee />} />
          <Route path="/fee-calculator/*" element={<FeeCalculatorPage />} /> {/* Ensure this route is defined */}
          <Route path="/logout" element={<Logout />} />
        </Routes>
      </Box>
      <Container maxWidth="lg" sx={{ mt: 4, backgroundColor: '#333', color: '#fff', padding: 4, borderRadius: 2 }}>
        <Typography variant="h3" gutterBottom>
          Fee Calculator
        </Typography>
        <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
          <TextField
            label="Sale Price"
            variant="outlined"
            type="number"
            value={salePrice}
            onChange={(e) => {
              const value = parseFloat(e.target.value);
              if (value <= 10000) {
                setSalePrice(e.target.value);
              }
            }}
            inputProps={{ min: 0, max: 10000 }}
            sx={{ borderRadius: 1 }}
          />
          <Select
            label="Marketplace"
            variant="outlined"
            value={marketplace}
            onChange={(e) => setMarketplace(e.target.value)}
            sx={{ borderRadius: 1 }}
          >
            <MenuItem value="Depop">Depop</MenuItem>
            <MenuItem value="Ebay">Ebay</MenuItem>
            <MenuItem value="Mercari">Mercari</MenuItem>
            <MenuItem value="Offerup">Offerup</MenuItem>
            <MenuItem value="Poshmark">Poshmark</MenuItem>
            <MenuItem value="StockX">StockX</MenuItem>
          </Select>
          <Button
            variant="contained"
            color="primary"
            onClick={() => {
              handleCalculateFee();
              setSelectedMarketplace(marketplace);
            }}
            sx={{ backgroundColor: '#1976d2' }}
          >
            Calculate Fee
          </Button>
          {fee !== null && (
            <Box sx={{ mt: 2, p: 2, border: '1px solid', borderColor: 'grey.300', borderRadius: 1, backgroundColor: '#444' }}>
              <Typography variant="h6" align="center">
                The fee for selling on {selectedMarketplace} is ${typeof fee === 'number' ? fee.toFixed(2) : 'N/A'}
              </Typography>
            </Box>
          )}
          {error && (
            <Box sx={{ mt: 2, p: 2, border: '1px solid', borderColor: 'error.main', borderRadius: 1, backgroundColor: '#444' }}>
              <Typography variant="h6" color="error" align="center">
                An error occurred, try again later
              </Typography>
            </Box>
          )}
        </Box>
      </Container>
    </ThemeProvider>
  );
}

export default FeeCalculatorPage;
